local HttpService = game:GetService("HttpService")
local Players = game:GetService("Players")
local TweenService = game:GetService("TweenService")

-- SETTINGS
local WEBHOOK_URL = "" 
local NOTIFY_DURATION = 3 -- seconds

-- GET INFO
local player = Players.LocalPlayer
local username = player and player.Name or "Unknown"

local function getHWID()
    return HttpService:GenerateGUID(false) -- Simulated HWID
end

-- SEND WEBHOOK
local function sendExecutionNotification()
    local payload = {
        ["content"] = "",
        ["embeds"] = {{
            ["title"] = "Script Executed 🚨",
            ["color"] = 16711680, -- red
            ["fields"] = {
                {name = "Username", value = username, inline = true},
                {name = "HWID", value = getHWID(), inline = true},
                {name = "Timestamp", value = os.date("%Y-%m-%d %H:%M:%S"), inline = false}
            }
        }}
    }
    local jsonData = HttpService:JSONEncode(payload)
    HttpService:PostAsync(WEBHOOK_URL, jsonData, Enum.HttpContentType.ApplicationJson)
end
